import React, { Component } from 'react'
import './styles/.css';

class Food extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div
        style={{ top: this.props.top + "px", left: this.props.left + "px" }}
        className="food"
      />
    );
  }
}

export default Food;
